import axios from "axios";
import { useEffect, useState } from "react";

function GetData(){
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get("http://api.quotable.io/random")
        .then(res => {
            setData(res.data.content)
        }).catch(err => console.log(err))
    }, []);


}
export default GetData;
